import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import video from './videos/dna5.gif'
import { Tabs, Tab } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header1">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools </p3>
            <img src={video} alt="gif"/>
          </h1>
          <Tabs defaultActiveKey="Description">
            <Tab eventKey="Description" title="Description">
              <p classname="App-Description"> 
                <br/> This website aims to aid the understanding of GC content in 
              </p>
            </Tab>
            <Tab eventKey="GC Content" title="GC Content"></Tab>
            <Tab eventKey="Transcription" title="Transcription"></Tab>
          </Tabs>
        </Jumbotron>
      </header>
    </div>


  );
}

export default App;
